import React,{useState} from "react";
import Header from "../../components/Header/Header";
import Footer from "../../components/Footer";
import s from "./FormTicket.module.scss"
function FormTicket (){
    const [response, setResponse] = useState("");
    // console.log(response);
    return(
        <>
        <Header/>
        <form className={s.passengerForm} 
        // onSubmit={onPassengerForm} 
        >
        <div class="name_group">
        <label for="name">Your Name:</label>
        <input type="text" id="name" name="passenger_name"  className={s.name} placeholder="John" />
        </div>
        <div class="surname_group">
        <label for="surname">Your Surname:</label>
        <input type="text" id="surname" name="passenger_surname"  className={s.surname} placeholder="Walker" />
        </div>
        <div class="email_group">
        <label for="email">Your Email:</label>
        <input type="email" id="email" name="passenger_email"  className={s.email} placeholder="john.walker@email.com" />
        </div>
        </form>
        <Footer/>
        </>
    )
}
export default FormTicket;
